Text:
Oʻzbekka qoyil qolmay iloj yoʻq. Chunki:

1. Mustaqillikka tish-tirnogʻi bilan qarshi boʻlgan Islom Karimovni "mustaqillik meʼmori" deydiyu, unga mustaqillikni bergan Mixail Gorbachyovga laʼnat oʻqiydi;

2. Mustaqillik uchun kurashganlarni "vatangado" va "xalq dushmani" deydiyu, mustaqillikka tish-tirnogʻi bilan qarshi boʻlganlarni "vatanparvar" deb olqishlaydi;

3. Toshkentda qatagʻon qurbonlariga atab yodgorlik majmuasi, bosqinchilarga atab butxona qurgan;

4. Mustaqillik kunini bayram qiladiyu SSSR qulagan kunni eslab koʻzyoshi toʻkadi;

5. Namoz oʻqiydiyu, Stalinni dohiy deb ataydi;

6. Choʻchqa goʻshtini yemaydiyu aroqni bemalol ichaveradi;

7. Hayotidan ertayu kech noliydiyu har gal bitta rahbarni saylaydi;

8. Dunyoda eng yirik gaz zaxirasiga egayu qishda tezak yoqadi;

9. Oltin ishlab chiqarish boʻyicha dunyoda yetakchiyu choʻntagi teshik;

10. Ayollarni "sochi uzun aqli kalta" deydiyu, 8 mart kunga uning sharafiga qoʻshiq kuylaydi.

11. Amerikani yomon deydiyu, grin kard yutishni orzu qiladi

12. Yevropani geyropa deydiyu u yerdan boshpana olishni orzu qiladi;

Bunaqa paralellarni yuzlab keltirish mumkin.
